import React from "react";
// import Navbar from "./gym/Navbar";
import Header from "../gym/Header";
import WhyYoga from "../gym/WhyYoga";
import Hero from "../gym/Hero";
import Classes from "../gym/Classes";

import Stories from "../gym/Stories.js";
import Footer from "../gym/Footer";
import "../gym/app.css";

const About = () => {
  return (
    <div className="App">
      {/* <Navbar /> */}
      <Header />
      <WhyYoga />
      <Hero />
      <Classes />

      <Stories />

      <Footer />
    </div>
  );
};

export default About;
